import React, { useState } from 'react';
import {
	Container,
	Grid,
	Button,
	TextField,
	Card,
	CardActionArea,
	CardMedia,
	CardActions,
} from '@material-ui/core';
import './Home.css';
import Input from '../../components/UI/Input';

const images = [
	'data:image/png;base64,',
	'data:image/png;base64,',
	'data:image/png;base64,',
	'data:image/png;base64,',
	'data:image/jpeg;base64,',
	'data:image/jpeg;base64,',
];

const Home = () => {
	const [showImage, setShowIamge] = useState(false);

	const handleSeacrh = () => {
		setShowIamge(true);
	};

	let imageArea = null;

	if (showImage) {
		imageArea = images.map((imgUrl) => (
			<Grid key={imgUrl} item xs={12} sm={4} md={4} lg={4}>
				<Card style={{ height: '100%' }}>
					<CardActionArea>
						<CardMedia component='img' image={imgUrl} />
					</CardActionArea>
					<CardActions
						style={{
							display: 'flex',
							alignItems: 'center',
							justifyContent: 'center',
						}}>
						<Button size='small' variant='contained' color='primary'>
							Save
						</Button>
					</CardActions>
				</Card>
			</Grid>
		));
	}

	return (
		<Container fixed>
			<Grid container spacing={1}>
				<Grid item xs={12} sm={11} md={11} lg={11}>
					<TextField label='Search' fullWidth />
				</Grid>
				<Grid item xs={12} sm={1} md={1} lg={1}>
					<Button
						variant='contained'
						color='primary'
						size='small'
						style={{ margin: '20px' }}
						onClick={handleSeacrh}>
						Search
					</Button>
				</Grid>
				{imageArea}
			</Grid>
		</Container>
	);
};

export default Home;
